window.bookSummaryJSON = "<p><i>If society collapsed, could you survive?</i> </p> <p>When Morgan Carter's car breaks down 250 miles from his home, he figures his weekend plans are ruined. But things are about to get much, much worse: The country's power grid has collapsed. There is no electricity, no running water, no Internet, and no way to know when normalcy will be restored - <i>if</i> it ever will be. </p> <p>An avid survivalist, Morgan takes to the road with his prepper pack on his back. During the grueling trek from Tallahassee to his home in Lake County, chaos threatens his every step but Morgan is hell-bent on getting home to his wife and daughters - and he'll do whatever it takes to make that happen. </p> <p>Fans of James Wesley Rawles, William R. Forstchen's <i>One Second After</i>, and <i>The End</i> by G. Michael Hopf will revel in A. American's apocalyptic tale.</p>"; 
